const initState = {
    authResponse:null
}

const AuthReducer = (state=initState, action) =>{
	switch(action.type){
		case 'SHORT_PASSWORD':
			return{
				...state,
				authResponse: 'Password is to short.'
			};
		case 'SIGNUP_SUCCESS':
			return{
				...state,
				authResponse: 'Your account is created successfully!.'
			};
	    case 'CODE_ERROR':
			return{
				...state,
				authResponse: 'Your account is created successfully!.'
			};
		case 'SIGNUP_ERROR':
			return{
				...state,
				authResponse: 'There is a problem .Please try again later .'
			};
		case 'LOGIN_SUCCESS':
			return{
				...state,
				authResponse: 'Your account is created successfully!.'
			};
		case 'LOGIN_ERROR':
			return{
				...state,
				authResponse: 'There is a problem .Please try again later .'
			};
	    default: return state;
	}
}
